window.jsPDF = require("jspdf");

const isInventoryStaff = ref(true);
const isNonInventoryStaff = ref(true);
const YesNonStaff = ref(false);
let auth;

const supplierReceiptRef = collection(db, "supplier-receipts");

export default {
  components: {
    PhotoCapture,
  },
  data: () => ({
    imageBase64: null,
    itemImage:
      "https://firebasestorage.googleapis.com/v0/b/istak-2208e.appspot.com/o/supplier-receipts%2Fplaceholder.jpg?alt=media&token=5d4f0246-1a76-4020-8ba0-d09750875ef4",
    loadingTable: true,
    // icon data
    editIcon: mdiPencil,
    deleteIcon: mdiDelete,
    successIcon: mdiCheckboxMarkedCircleOutline,
    searchIcon: mdiMagnify,
    pdfIcon: mdiFilePdfBox,
    moreIcon: mdiDotsVertical,
    emailIcon: mdiEmail,
    splrIcon: mdiDolly,
    receiptIcon: mdiReceipt,

    // receipt data
    receiptData: [
      {
        src:
          "https://firebasestorage.googleapis.com/v0/b/istak-2208e.appspot.com/o/supplier-receipts%2Fplaceholder.jpg?alt=media&token=5d4f0246-1a76-4020-8ba0-d09750875ef4",
      },
    ],
    currentId: "",

    // modal data
    dialog: false,
    dialogDelete: false,
    dialogSendEmail: false,
    receiptDialog: false,
    capturePhoto: false,

    //search and select data
    search: "",
    selected: [],
    expanded: [],
    singleExpand: false,

    // table header data
    // headers: [{
    //   text: 'Name',
    //   align: 'start',
    //   value: 'name',
    // },
    // {
    //   text: 'Email',
    //   sortable: false,
    //   value: 'email'
    // },
    // {
    //   text: 'Contact Number',
    //   sortable: false,
    //   value: 'contactno'
    // },
    // {
    //   text: 'Contact Person',
    //   sortable: false,
    //   value: 'contactper'
    // },
    // {
    //   text: 'Actions',
    //   value: 'actions',
    //   sortable: false
    // },
    // ],
    // table data
    items: [],
    itemIndex: -1,
    currentItem: {
      name: "",
      email: "",
      contactno: 0,
      contactper: "",
    },
    defaultItem: {
      name: "",
      email: "",
      contactno: 0,
      contactper: "",
    },

    // add item
    dataItem: {
      name: "",
      email: "",
      contactno: 0,
      contactper: "",
    },

    //rules
    valid: true,
    itemNameRules: [(v) => !!v || "This field is required"],

    //contactrules
    inputRules: [
      (v) => v.length >= 11 || "Minimum length is 11 numbers",
      (v) => !!v || "This field is required",
    ],

    //namerules
    nameRules: [(v) => v.length >= 3 || "Minimum length is 3 characters"],

    //edit item
    itemId: null,
    docRef: null,

    //email item
    itemId: null,
    docRef: null,

    //snackbar
    snackbar: false,
    timeout: 3000,
    itemStatus: "",

    //show delete button
    showDelete: false,

    //email
    sendData: {
      toEmail: "",
      fromEmail: "",
      subject: "",
      message: "",
    },

    //pdf contents
    business: "Assumpta Dog and Cat Clinic - Cainta Branch",
    address:
      "Ortigas Ave., Extension Corner Hunter ROTC. Guerilla St. Brgy. San Juan, Cainta Rizal",
    contact: "09190090841 / 09269910470 / 897-3264 / assumptacainta.yahoo.com",
    report: "Supplier List Report",

    //analytics
    totalsupplier: 0,
    totalemail: 0,
  }),

  setup() {
    onMounted(() => {
      auth = getAuth();
      onAuthStateChanged(auth, async (user) => {
        if (user) {
          const q = query(collection(db, "users"));
          const querySnapshot = await getDocs(q);
          querySnapshot.forEach((doc) => {
            if (user.uid === doc.id) {
              //console.log(doc.data().role)
              if (doc.data().role == "Inventory Staff") {
                isInventoryStaff.value = false;
                YesNonStaff.value = false;
              } else if (doc.data().role == "Non-Inventory Staff") {
                isInventoryStaff.value = false;
                isNonInventoryStaff.value = false;
                YesNonStaff.value = true;
              } else {
                isInventoryStaff.value = true;
                isNonInventoryStaff.value = true;
                YesNonStaff.value = false;
              }
            }
          });
        }
      });
    });
    return {
      isInventoryStaff,
      isNonInventoryStaff,
    };
  },

  computed: {
    // to change modal to add or edit
    formTitle() {
      return this.itemIndex === -1 ? "New Supplier" : "Edit Supplier";
    },

    headers() {
      const headers = [
        {
          text: "Name",
          align: "start",
          value: "name",
        },
        {
          text: "Email",
          sortable: false,
          value: "email",
        },
        {
