          sortable: false,
          value: "contactno",
        },
        {
          text: "Contact Person",
          sortable: false,
          value: "contactper",
        },
      ];

      //console.log(isNonInventoryStaff.value)
      //console.log("Value: " + YesNonStaff.value)

      if (YesNonStaff.value) {
        return headers;
      } else {
        headers.push({ text: "Actions", value: "actions", sortable: true });
        return headers;
      }
    },
  },

  watch: {
    dialog(val) {
      val || this.close();
    },
    dialogDelete(val) {
      val || this.closeDelete();
    },
  },

  created() {
    // to fetch data
    this.initialize();
  },

  methods: {
    async initialize() {
      onSnapshot(inventoryColRef, (snapshot) => {
        let items = [];
        snapshot.forEach((doc) => {
          items.push({
            ...doc.data(),
            id: doc.id,
          });
        });
        this.items = items;
        this.loadingTable = false;
        //TOTAL SUPPLIERS
        this.totalsupplier = items.length;
      });

      onSnapshot(emailColRef, (snapshot) => {
        let items2 = [];
        snapshot.forEach((doc) => {
          items2.push({
            ...doc.data(),
            id: doc.id,
          });
        });
        this.items2 = items2;
        this.loadingTable = false;
        //TOTAL EMAIL
        this.totalemail = items2.length;
      });
    },

    dataURLtoFile(dataurl, filename) {
      var arr = dataurl.split(","),
        mime = arr[0].match(/:(.*?);/)[1],
        bstr = atob(arr[1]),
        n = bstr.length,
        u8arr = new Uint8Array(n);

      while (n--) {
        u8arr[n] = bstr.charCodeAt(n);
      }

      return new File([u8arr], filename, { type: mime });
    },

    reload() {
      this.currentId = "";
      this.receiptDialog = false;
    },

    done(picture) {
      this.capturePhoto = false;
      var currentdate = new Date();
      let file = this.dataURLtoFile(picture, "receipt" + currentdate);
      const storage = getStorage();
      const storageRef = ref_storage(storage, "supplier-receipts/" + file.name);

      const uploadTask = uploadBytesResumable(storageRef, file, "data_url");

      uploadTask.on(
        "state_changed",
        (snapshot) => {
          const progress =
            (snapshot.bytesTransferred / snapshot.totalBytes) * 100;
          // this.uploadBtnText = "Uploading: " + progress.toFixed(0) + "%";
          // this.uploadBtnTextMobile = mdiProgressDownload;
          //this.uploadBtnTextMobile = "Uploading: " + progress.toFixed(0) + '%';

          switch (snapshot.state) {
            case "paused":
              console.log("Upload is paused");
              break;
            case "running":
              console.log("Upload is running");
              break;
          }
        },
        (error) => {
          // Handle unsuccessful uploads
        },
        () => {
          // Handle successful uploads on complete
          // For instance, get the download URL: https://firebasestorage.googleapis.com/...
          // this.uploadBtnText = "Uploaded Successfully";

          // this.uploadBtnTextMobile = mdiCheckCircle;
          //this.uploadBtnTextMobile = 'Photo Uploaded';
          getDownloadURL(uploadTask.snapshot.ref).then(async (downloadURL) => {
            console.log("File available at", downloadURL);
            this.itemImage = downloadURL;
            await addDoc(collection(db, "supplier-receipts"), {
              id: this.currentId,
              image: "" + downloadURL,
              timestamp: Timestamp.now(),
            });
          });
        }
      );
    },

    async deleteReceipt(id) {
      console.log("helo " + id);
      await deleteDoc(doc(supplierReceiptRef, id));
      this.itemStatus = "Deleted";
      this.snackbar = true;
    },

    openReceipt(id) {
      this.receiptDialog = true;
      this.currentId = id;

      let images = [];

      onSnapshot(supplierReceiptRef, (snapshot) => {
        snapshot.forEach((doc) => {
          if (doc.data().id === id) {
            images.push({
              image_id: doc.id,
              src: "" + doc.data().image,
              timestamp: moment(doc.data().timestamp.toDate()).format(
                "MMM DD, YYYY (ddd)"
              ),
            });
          }
        });
        if (images.length != 0) {
          this.receiptData = images;
          images = [];
        } else {
          this.receiptData = [
            {
              src:
                "https://firebasestorage.googleapis.com/v0/b/istak-2208e.appspot.com/o/supplier-receipts%2Fplaceholder.jpg?alt=media&token=5d4f0246-1a76-4020-8ba0-d09750875ef4",
