    generatePDF() {
      const columns = [
        {
          title: "Supplier Name",
          dataKey: "name",
        },
        {
          title: "Email",
          dataKey: "email",
        },
        {
          title: "Contact Number",
          dataKey: "contactno",
        },
        {
          title: "Contact Person",
          dataKey: "contactper",
        },
      ];

      const pdf = new jsPDF({
        orientation: "portrait",
        unit: "in",
        format: "a4",
      });

      // let footerPath = path.resolve("../../assets/images/logos/google.png")
      // let footer = fs.readFileSync(footerPath,{
      //   encoding: "base64",
      // });

      // let footer = new Image();
